// Helper to get field from nested or flat structure
function getField(product, nestedPath, flatKey, defaultVal) {
    if (!product) return defaultVal;
    let value = product;
    for (const key of nestedPath){
        if (value && typeof value === 'object' && key in value) {
            value = value[key];
        } else {
            value = undefined;
            break;
        }
    }
    if (value !== undefined && value !== null) return value;
    const flatValue = product[flatKey];
    if (flatValue !== undefined && flatValue !== null) return flatValue;
    return defaultVal;
}
